import React, { Component } from "react";

class Gebäudeliste extends Component {
  constructor(props) {
    super(props); //since we are extending class Table so we have to use super in order to override Component class constructor
    this.state = {
      //state is by default an object
      buildings: [
        {
          id: 1,
          Gebäudenummer: "1",
          Facility: "University",
          Name: "Geography",
          Straße: "Kerpener Str. 68"
        },
        {
          id: 2,
          Gebäudenummer: "2",
          Facility: "University",
          Name: "Geography",
          Straße: "Kerpener Str. 68"
        },
        {
          id: 3,
          Gebäudenummer: "3",
          Facility: "University",
          Name: "Geography",
          Straße: "Kerpener Str. 68"
        },
        {
          id: 4,
          Gebäudenummer: "4",
          Facility: "University",
          Name: "Geography",
          Straße: "Kerpener Str. 68"
        }
      ]
    };
  }

  renderTableData() {
    return this.state.buildings.map((building, index) => {
      const { id, Gebäudenummer, Facility, Name, Straße } = building; //destructuring
      return (
        <tr key={id}>
          <td>{id}</td>
          <td>{Gebäudenummer}</td>
          <td>{Facility}</td>
          <td>{Name}</td>
          <td>{Straße}</td>
        </tr>
      );
    });
  }

  render() {
    //Whenever our class runs, render method will be called automatically, it may have already defined in the constructor behind the scene.
    return (
      <div className='dummy'>
        <h2 className='dummyText'>Gebäudeübersicht</h2>
        <div id='container-table'>
          <table class='u-full-width'>
            <thead>
              <tr class='tr-first'>
                <th>Gebäudenidummer</th>
                <th>Gebäudenummer</th>
                <th>Klinikum/Universität</th>
                <th>Name/Nutzer</th>
                <th>Straße</th>
              </tr>
            </thead>
            <tbody>{this.renderTableData()}</tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default Gebäudeliste;
